import React from "react"
import ReactDOM from "react-dom"

function Imagedata() {
    var img = require('./hello.jpg')
    return (
        <div>
            <body>
                <div>
                    <h1>Image</h1>
                    <img src = {img.default}/>
                </div>
            </body>
        </div>
    )
}

export default Imagedata
